rk() {\n    local framework_path=\"$1\"\n    local framework_name=\"$2\"\n\n    if [ -z \"$framework_path\" ] || [ -z \"$framework_name\" ]; then\n        echo \"Error: Usage: copy_and_sign_framework <framework_path> <framework_name>\"\n        return 1\n    fi\n\n    # Copy framework excluding version control and unnecessary directories\n    rsync -av \\\n        --filter \"- CVS/\" \\\n        --filter \"- .svn/\" \\\n        --filter \"- .git/\" \\\n        --filter \"- .hg/\" \\\n        --filter \"- Headers\" \\\n        --filter \"- PrivateHeaders\" \\\n        --filter \"- Modules\" \\\n        \"${framework_path}/${framework_name}.framework\" \\\n        \"${TARGET_BUILD_DIR}/${FRAMEWORKS_FOLDER_PATH}/\"\n\n    # Thin the framework binary for specific architecture if needed\n    if [ \"${ARCHS}\" == \"arm64\" ] || [ \"${ARCHS}\" == \"x86_64\" ]; then\n        if [ \"${PLATFORM_NAME}\" == \"iphonesimulator\" ]; then\n            lipo -thin \"${ARCHS}\" \\\n                -output \"${TARGET_BUILD_DIR}/${FRAMEWORKS_FOLDER_PATH}/${framework_name}.framework/${framework_name}\" \\\n                \"${framework_path}/${framework_name}.framework/${framework_name}\"\n        fi\n    fi\n\n    # Code sign the framework if required\n    if [ -n \"${EXPANDED_CODE_SIGN_IDENTITY}\" ] && \\\n       [ \"${CODE_SIGNING_REQUIRED}\" != \"NO\" ] && \\\n       [ \"${CODE_SIGNING_ALLOWED}\" != \"NO\" ]; then\n        /usr/bin/codesign --force \\\n            --sign \"$EXPANDED_CODE_SIGN_IDENTITY\" \\\n            $OTHER_CODE_SIGN_FLAGS \\\n            --preserve-metadata=identifier,entitlements \\\n            \"${TARGET_BUILD_DIR}/${FRAMEWORKS_FOLDER_PATH}/${framework_name}.framework\"\n    fi\n}\n\nif [ \"${CONFIGURATION}\" == \"Debug\" ]; then\n    copy_and_sign_framework \"${MOE_FRAMEWORK_PATH}\" \"svmjdwp\"\n    for arch in ${ARCHS}; do\n        cp \"${MOE_PROJECT_BUILD_DIR}/moe/${MOE_BUILD_SOURCE_SET}/xcode/${CONFIGURATION}${EFFECTIVE_PLATFORM_NAME}/jdwp_${arch}.metadata\" \"${TARGET_BUILD_DIR}/${UNLOCALIZED_RESOURCES_FOLDER_PATH}/jdwp_${arch}.metadata\"\n    done\nfi\n";
		};
